import React from 'react';

import './styles.css'
import '../../assets/styles/global.css'
import logoImg from '../../assets/images/logo.svg';

import purpleHeartIcon from '../../assets/images/icons/purple-heart.svg';


function Landing() {

    function show() {
        var p = document.getElementById('eye');
        p.setAttribute('type', 'text');
    }

    function hide() {
        var p = document.getElementById('eye');
        p.setAttribute('type', 'password');
    }

    function showHide() {
        var pwShown = 0;
        document.getElementById("eye").addEventListener("click", function () {
            if (pwShown == 0) {
                pwShown = 1;
                show();
            }
            else {
                pwShow = 0;
                hide();
            }
        }, false);

    }










    return (
        <div id="page-landing">
            <div id="page-landing-content" className="container">
                <div className="logo-container">

                    <img className="logo" src={logoImg} alt="Proffy" />
                    <h2>Sua plataforma de estudos online.</h2>
                </div>
                <div className="login-container">
                    <form>
                        <h2>Fazer Login</h2>
                        <div className="input-block">
                            <input type="text" name="email" id="email" placeholder="email" />
                            <input type="password" name="password" id="password" placeholder="password" />



                            <input type="password" placeholder="Password" id="pwd" className="masked" name="password" />
                            <button type="button" id="eye">
                                <img src="eye.png" alt="eye" />
                            </button>


                        </div>
                        <div className="lembrar">
                            <div className="input-group mb-3">
                                <div className="input-group-prepend">
                                    <div className="input-group-text">
                                        <input type="checkbox" aria-label="Checkbox for following text input" />
                                        <label htmlFor=""> Lembre-me</label>
                                    </div>
                                </div>
                            </div>
                            <span>Esqueci minha senha</span>
                        </div>
                        <button className="btnLogin">Entrar</button>
                        <div id="footer">
                            <p>Não tem conta?</p>
                            <span>É de graça <img src={purpleHeartIcon} alt="Coração roxo" /></span>
                        </div>
                        <span className="sign">Cadastre-se</span>
                    </form>

                </div>
            </div>
        </div>
    )

}

export default Landing;
